INSERT INTO `enquiries` (`id`, `date_created`, `sent_by`, `sent_to`, `subject`, `message`, `opened`, `code`, `urgent`, `ranking`) VALUES
(1, 1471945289, 0, 1, 'Do you think that the Gibson Les Paul is a better guitar than the Ibanez Gem?', 'I want to know something. Can the Fender American Deluxe Dimension Bass IV HH RW in Violin Burst be delivered before Christmas?  Let me also ask you, can I exchange my old guitar for an effects board?  I currently have a Fender FSR USA Pro Stratocaster HSS in Olympic White. Loving your website.  Keep up the good work!<br><br>Thank you,<br><br>Joe Jones', 0, 'P8MBfH', 0, 0),
(2, 1471945289, 0, 1, 'What is the best guitar for shred?  Is it a Fender Stratocaster or a Fender Telecaster? ', 'I have been looking around your website. Is the Fender FSR American Vintage 70s Strat in Black available with a rosewood fretboard?  And finally, can the Fender Special Run Stratocaster HSS in Candy Red Burst be retro fitted with locking machine heads? There is no rush with this one, however, I am ready to buy.<br><br>Yours Sincerely,<br><br>Valerie Berry', 0, 'LTHC25', 0, 0),
(3, 1471945289, 0, 1, 'Is the Gibson Les Paul available with a maple neck?', 'I hope this does not sound stupid. Can the Fender American Special Tele RW in 3 Colour Sunburst be used for classical music?  For the purposes of clarification, can I also ask, does the Fender Steve Harris P Bass in West Ham Colours have a faster neck than the Fender FSR Classic Series 50s Stratocaster in Jetstream Blue? There is no rush with this one, however, I am ready to buy.<br><br>Yours Sincerely,<br><br>Roger Franklin', 0, '2R7RyS', 0, 0),
(4, 1471945289, 0, 1, 'Do you think that the Gibson Les Paul is a better guitar than the Ibanez Gem?', 'I hope this does not sound stupid. Is the Fender Special Run Stratocaster HSS in Candy Red Burst available with a rosewood fretboard?  Also, can I exchange my old guitar for an effects board?  I currently have a Fender Deluxe Lone Star Stratocaster Guitar in Burgundy Mist. I hope I have not just made a fool out of myself.<br><br>Thank you,<br><br>Joe Sorenson', 0, '9t8DJC', 0, 0),
(5, 1471945289, 0, 1, 'Thinking about buying a strat', 'I hope this is the right person. What is the best guitar for shred?  Is it a Squier Vintage Modified Bass VI in 3 Colour Sunburst or a Fender Coronado Guitar in 3 Colour Sunburst?  For the purposes of clarification, can I also ask, can the Fender American Deluxe Dimension Bass IV HH RW in Violin Burst be retro fitted with locking machine heads? I hope that is not an awkward question.<br><br>I hope to hear from you,<br><br>Jim Jones', 0, '6CWyjM', 0, 0),
(6, 1471945289, 0, 1, 'Question about Fender', 'I hope this does not sound stupid. I would like to swap my Fender Paramount PM3 000 Cutaway - Standard Natural for a Fender Paramount PM3 000 Cutaway - Standard Natural. It only has a few dents.  Are you interested?  Another thing I wanted to ask was can the Fender Steve Harris P Bass in West Ham Colours be fitted with guage 8 strings? I''d be very grateful if you could find out for me.<br><br>Yours Faithfully,<br><br>Michael Baker', 0, 'nW7B83', 0, 0),
(7, 1471945289, 0, 1, 'Question about Fender', 'I hope this is the right person. I would like to swap my Fender Classic Player Baja Tele in Blonde with Maple Neck for a Fender Classic 70s Strat in Black. It only has a few dents.  Are you interested?  I''d like to also ask, is the Fender FSR Stratocaster in Black with Maple Neck available with a maple neck? Please let me know ASAP.<br><br>I hope to hear from you,<br><br>Steven Lewis', 0, 'k3Mzkz', 0, 0),
(8, 1471945289, 0, 1, 'I noticed that Andertons are selling the Fender Stratocaster for much less than you. Do you price match? ', 'Can you clarify something for me? What is the best guitar for shred?  Is it a Fender Japan FSR Classic 69 Telecaster in Blue Flower or a Fender Steve Harris P Bass in West Ham Colours?  And finally, is it true that you are giving away a free amp for anyone who buys a Fender American Deluxe Strat Plus HSS in Metallic 3 Tone Sunburst or a Fender Classic 70s Strat in Black? Loving your website.  Keep up the good work!<br><br>Thank you,<br><br>Steven Lewis', 0, 'tJWaJe', 0, 0),
(9, 1471945289, 0, 1, 'Does the Gibson Les Paul come with humbucker pickups?', 'Can I bother you for a minute? I noticed that Andertons are selling the Squier Mini Strat in Red for much less than you. Do you price match?  Another thing I wanted to ask was do you think that the Fender FSR Stratocaster in Black with Maple Neck is a better guitar than the Fender Coronado Guitar in Candy Apple Red? I hope I have not just made a fool out of myself.<br><br>With Best Wishes,<br><br>Steven Lewis', 0, 'whFmTU', 0, 0),
(10, 1471945289, 0, 1, 'Does the Gibson Les Paul come with humbucker pickups?', 'I want to know something. If I buy a Fender Coronado Guitar in 3 Colour Sunburst today, can I swap it for a Fender Japan FSR Classic 69 Telecaster in Blue Flower if I do not like it?  Also, does the Fender American Deluxe Strat Plus HSS in Metallic 3 Tone Sunburst come with humbucker pickups? I appreciate everything you are doing.<br><br>Regards,<br><br>Jim Jones', 0, 'VJrvzD', 0, 0),
(11, 1471945289, 0, 1, 'Can the Fender Stratocaster be delivered before Christmas? ', 'Sorry to bother you. Is the Fender Paramount PM3 000 Cutaway - Standard Natural suitable for beginners?  And finally, does the Fender American Elite Strat HSS Shawbucker MN in Mystic Black have a faster neck than the Fender Steve Harris P Bass in West Ham Colours? Hopefully you can find the time to find an answer.<br><br>Yours Sincerely,<br><br>Luke Berry', 0, 'V2aLLW', 0, 0),
