(1001, 1493631675, 1, 0, 'rambo on war', 'rthis is tjhlfb;', 0, 'aBGk5r', 0, 0),
(1002, 1493631745, 1, 0, 'urgent', 'fdskjgkj', 1, 'tTVsFQ', 1, 0),
(1003, 1493638121, 1, 0, 'metalbanger', 'sfnnaln', 1, 'NSSVtS', 1, 0),
(1004, 1493648845, 0, 1, 'metalbanger', 'We got your message. Thanks for suggesting.<div xss=removed><br></div><div xss=removed>Thanks </div><div><b xss=removed>-Metalhead101-</b>  CISHOP moderator<br><br>\r\n        ------------------------------------------------------------<br>\r\n        The original message is shown below:<br><br>sfnnaln</div>', 1, '6WBWQf', 0, 0),
(1005, 1493651555, 1, 0, 'Is the Fender Stratocaster suitable for beginners? ', 'Thank you for sending us reply .... I am happy customer.\r\n\r\n\r\n-------------------------------------------------------------------------\r\nI hope this is the right person. I would like to swap my Fender American Standard Offset Telecaster in 2 Tone Sunburst for a Fender Japan FSR Texas Special Classic 68 Strat 3 Tone Sunburst. It only has a few dents.  Are you interested?  Let me also ask you, do you think that the Fender American Deluxe Dimension Bass V HH Black is a better guitar than the Fender American Deluxe Dimension Bass IV HH RW in Violin Burst? I hope that is not an awkward question.\r\n\r\nYours Faithfully,\r\n\r\nSteven Ortega', 1, 'zsdZKz', 0, 2),
(1007, 1493696546, 0, 0, 'Contact Form', 'Metalhead101 submitted following information : <br><br><br><br>Name : Metalhead101<br>Email : adwinmetal110@gmail.com<br>Telnum : 9819284986<br>Message : I want to buy Les Paul Vintage guitar. Can you guyz please send me a quote. So i can make up my mind ..\r\n\r\n\r\nThanks \r\n-metalhead101-<br>', 1, 'Pkhwmr', 0, 3),
(1008, 1494177670, 0, 1, 'Order Status Update', 'Order JCHC6N has just been updated.Current status: Goods Dispatched', 1, 'Gx5Mkk', 0, 0),
(1009, 1495352602, 1, 0, 'Need help With test', 'dsfndsgn', 1, 'NJqBUs', 1, 0),
(1010, 1495353078, 0, 1, 'Need help With test', '<br><br>\r\n        ------------------------------------------------------------<br>\r\n        The original message is shown below:<br><br>dsfndsgn<div><br></div><div><br></div><div>We will contact </div>', 0, 'jEcQnB', 0, 0);
